"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/22AF-MNamd5NFVuYXfAZAA/l.jpg",
"rating":"4.0",
"reviewcomment":"I ate at Weisses Brauhaus this past October, and it was awesome! The restaurant is located in a very central area of the city, close to many of the tourist attractions. The employees are dressed in lederhosen. Thankfully, they have menus in English.<br><br>We started with a basket of the most delicious soft pretzels that I&#39;ve ever had. The beer was very tasty as well. I can&#39;t remember the name of what I ordered, but it was sautéed potatoes and sauerkraut and so so good! My husband loved the pork knuckle, my friend devoured his plate of sausages and my other friend had a type of omelette that she really enjoyed as well. <br><br>I learned here that I am a big fan of German food and will definitely visit Weisses Brauhaus again!",
