"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/o9v6Vdz4NumTDkusoL8qMg/l.jpg",
"rating":"4.0",
"reviewcomment":"Wow. Best meal we&#39;ve had since coming to Germany. Quiet and not as swamped as the other brew pubs. Beer was on spot and meals were superb. I went with the beef schnitzel which came with a light potatoes salad. <br><br>My sisters boiled Ox won a landslide victory. It came with the first side of veggies I&#39;ve seen since the first week of August. The spinach it came with was cooked perfectly but what made the meal was the horseradish gravy that came on top of the Ox. Also try only had a German menu since they have a special menu for Xmas and our server walked us through each item. Best waiter we&#39;ve had and we&#39;ve been to four countries and 8 cities on this trip.",
