"rating":"3.5",
"reviewcomment":"It was 1:30 am and we were jet lagged from our journey from Los Angeles.  While looking for places open late we came across Bergwolf.  Although not a fan of curry wurst tried in Los Angeles, we figured we should give the original a chance and so glad we did.  The line was long, no place to sit inside and it was cold outside.  But it was all worth it when we got our grubby little gloved hands on the curry sausage and the fries perfect and crisp, delicious...<br><br>We tried to get back there the next night After long mishaps in our journey back from Inglestodt but could not remember the address.  Now address in hand, we will make sure to visit here at least a few more times before we leave Munich.",
