"rating":"4.5",
"reviewcomment":"This is the showroom part of the BMW complex. The newest models of the ultimate driving machine are here. There&#39;s an electric car you can test drive around the first floor. In the complex are the factory and the museum. There&#39;s a small portion for Mini and motorcycles. The top floor is a driving track where you can test drive your future purchase. So cool!<br><br>Like I need more reason to love BMW. It has been the most reliable car I&#39;ve ever owned and I plan on keeping it til it stops moving. So, a visit here was a must.<br><br>They have models we don&#39;t have in the US. It&#39;s German car heaven! They have restaurants here and merchandise stores. They have bathrooms downstairs and there was a guy in the women&#39;s restroom that shocked the heck out of me - and he proceeded to use his cellphone. A guy in the women&#39;s restroom using a cellphone! Hello? <br><br>They have free wifi.",
