"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/12SQ3XmbcwJPslK-m7npqw/l.jpg",
"rating":"3.5",
"reviewcomment":"Except for an apropos emphasis on deers, Wirtshaus im Hirschgarten is no different from other Bavarian restaurants. EXCEPT for their &#34;Culinary trips&#34; aka All-You-Can-Eat buffets, which is the first I have seen in a Biergarten and also all I can speak for in this review.<br><br>A friend recommended coming here for their &#34;All You Can Eat&#34; buffets, which start after 6 PM and offers a variety of main dishes, sides, and dessert. The type of buffet changes daily, ranging from &#34;Around the Roulade&#34; to &#34;American BBQ&#34; to &#34;Pasta Italiana.&#34; From buffet prices ranging from 12 to 17.50 EUR, it is a bargain!<br><br>We came for the &#34;Steak Tag,&#34; which is all about steaks. They offered (1) 4 choices of steaks: pork neck, pork loin, Ribeye, and a version of beef rump steak (Rinderhüftsteak), (2) 4 choices of dips: BBQ, sweet chili, sour cream, and herb butter, (3) fries/potato gratin/baked potatoes, (4) salad buffet of greens, red beets, olives, cabbage slaws, etc, and (5) Millirahm-Apfelstrudel (milk-cream apple strudel) with homemade vanilla and strawberry ice creams. All for 12.30 EUR.<br><br>The steaks were cooked nicely. The beef steaks were medium, juicy, and tender. Unfortunately, during the entire dinner, I managed to get only one piece of ribeye and the rest of the beef steaks was the beef rump. The potato sides were made to perfection. The salad bar and dessert were decent. In addition with our Augustiner beers, we left the restaurant stuffed and nearly passing out from food coma.<br><br>I could easily come back to try their other buffet selections.",
