"reviewcomment":"Well I heard a lot of good things about this place by my friends and i really wanted to try it. One fine night I was there with a few friends. Its not on the main street but one of the side lanes and hence always missed our attention. I am being told this one is quite old and famous not sure how old though. After visiting it once, I think this palce deserves to be a regualr hot spot for many in the city. <br><br>I already had my dinner so wasn&#39;t there for food, but for a few drinks and desserts. So on drinks you have an awesome bar. On desserts I was slightly disapointed as it didn&#39;t meet my expectation though. They have a seating arrangement outside as well. Best part was service which was top class. When you are there don&#39;t forget to meet a beautiful staff from Austria. She has wits and humour and that covered up for my not so great dessert experience. <br><br>As I have an davntage of being in the surrounding, I defientaly will go again here and spend some time. And if you are around here, I would totally recommend.",
