"reviewcomment":"My mom and I came here in the Winter and very much enjoyed it. <br>The atmosphere was lovely. <br>We went here because Donisl is Munich&#39;s oldest beer hall dating back to the 14th century. <br>Very spirited and traditionally German.<br>There was lots of singing and the clinking of beer glasses.<br>I don&#39;t remember what beer we tried- we just asked the waiter what he recommended.<br>It was dark, spicy, and wonderful. Everything you want out of your first glass of real German beer. <br>The food was good. With a bit of salt- the way we like it. Not the most amazing German cuisine, but it hit the spot nonetheless. <br>We had a couple more glasses of beer then started singing away with the accordion player. <br>It was awesome. A very memorable experience.",
