"rating":"4.0",
"reviewcomment":"Came here for breakfast before we hit the stores. We didn&#39;t really look to see what time they opened, but since there were people sitting at 9:40, we assumed they were open. Turns out they don&#39;t open until 10 so we just sat there till then. No big deal though. <br><br>We ordered 2 cappuccinos and my step mom ordered the breakfast platter that came with grapefruit, aloe Vera yogurt, fruit, cheese, and shrimp salad in half an avocado. I ordered the breakfast platter that came with smoked salmon, shrimp salad, cheese, fruit, and a boiled egg. Both came with a basket of freshly sliced bread. <br><br>These portions were huge!! We realized that we could have easily shared one, especially mine!! They were especially generous with the smoked salmon. I couldn&#39;t even touch my fruit at the end of the meal cause I was so full. <br><br>Service was decent <br><br>Great place to come if you&#39;re near the marienplatz! Either for a meal or a coffee and snack! We sat on the side opposite facing the glockenspiel, but it looked lovely!",
