"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/4_SyIOzry5Guo1x7yy5g7A/l.jpg",
"rating":"3.5",
"reviewcomment":"As I have already mentioned I am naturally suspicious of pizzerias outside of Italy :-)<br><br>I must say I found the place very very crowded and loud and chaotic and at first I was a bit annoyed. Then I reminded myself that I was there on my quest to find the best pizza in Munich, so I forced myself to focus only on the pizza and not to be influenced by anything else. <br><br>Did I find the best pizza there? No. :-) <br><br>Still it was above the Munich average (I am talking about the restaurant in the Leopoldstrasse, not sure about the other one), and I enjoyed it. <br><br>The only drawback for me (but it is for sure a plus for a lot of other people) is that the pizza is tooooo big, it basically sticks out of the plate and it&#39;s very difficult to slice and eat. In general I am not a fan of big portions, often, as the Germans say: &#34;weniger ist mehr&#34; :-)<br><br>The prices were OK and the service very efficient and fast, also considering how full the place tends to get...",
