"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/mQiNhxhQGlM68bJeN6qdTA/l.jpg",
"rating":"3.5",
"reviewcomment":"I have been here three times now and every time the food is consistently good. If you want to go here for dinner in the evenings, bookings are highly recommended. It is usually quite busy during dinner time. <br><br>The service here is unfortunately inconsistent and it can take ages to get the attention of the waiters. This is probably my only real complaint about the place. Last night it took us over 25 mins to get the bill and had to wait for ages to get drinks and food ordered as well. <br><br>The food here is consistently good. I absolutely love the Ente here. It is cooked to perfection and comes with a rich flavourful gravy. The duck is moist and falls away from the bone and tastes delicious. Similarly the Brotzeit Teller is excellent and comes with a selection of meats and obatzda. The obatzda here is divine and I love it.<br><br>One of the finest Bavarian restaurants in the area and I would happily come back here anyday. It would be better however if the service was a bit more consistent.",
