"reviewcomment":"SO weird and awesome. If you like tiki bars, Trader Vic&#39;s and history, AND weirdness (Hilarious German tiki cocktail names!) then check this place out. It&#39;s expensive, yet - all Trader Vic&#39;s are! But you can get giant fruity cocktails and delicious pupus. Plus the basement location is super dark and cozy. <br><br>Watch the cooks in the open kitchen and sit back and relax in your wicker peacock chair while you sip on a fruity drink and nibble on some crab Rangoon. <br><br>Our food was good (standard Trader Vic&#39;s stuff) and service was excellent even though my German is ... really pretty terrible. (Sorry! Working on it...)",
