"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/YPubIsQgmnTUtnBaaTYpkA/l.jpg",
"rating":"3.5",
"reviewcomment":"This place is next door and I always used to confuse it with a grand private villa where private parties are hosted. Not untill few months back I was told this is a beer garden. So I wanted to take a dig at it. Went to this palce one fine day crossing the luitpold park. The place is indeed a villa and looks grand but may be a bit maintanenace would be called for. The whole seating arranegment around the villa was the best part. You can laze around in the garden or prefer sitting on the porch and enjoy your beer. <br><br>On service front they were OK. But I don&#39;t blame them. Completely they are understaffed. My Nurenburger sausages took almost an hour to come and I patiently was enjoying our conversation with my friends, When suddenly a staff aplogises for the delay and offers a completmentary desert of our choice. I mean it was a nice gesture though. On quality of food, I have no reasons to complain. It was nice. <br><br>So, sometimes when you are in the neighbourhood, and want to get cozed in a Villa kind of surrounding then I think you can try this place.",
