"reviewcomment":"I had a really enjoyable dinner experience at Tenmaya. I chose it partly because I was in the mood for Japanese, and partly because it was walkable to my hotel and had an English menu online.<br><br>Only complaint - no actual English menu, so when I arrived, I had to do some deciphering.<br><br>Otherwise, a very good meal. The food was freshly made and prepared, well-seasoned but not overly salty. I had gyoza for an appetizer and an excellent seafood ramen for dinner. Both were delicious. The ramen had a nice combo of fish and shellfish, and was a satisfying portion. The other menu options included a wide range of sushi, several kinds of ramen dishes, and many other Japanese standards. I wished I had stayed longer just to try another meal there.<br><br>The staff were very friendly and helpful. My waiter was especially kind in helping me navigate the menu, which she kindly translated for me. She was also the right amount of attentive without being either overbearing or uninterested in me as the customer.<br><br>Overall, I can give Tenmaya a strong recommendation.",
