"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/-ZklSV8eXBniFYc8kEBsZQ/l.jpg",
"rating":"3.5",
"reviewcomment":"I went here for lunch today after a day of shopping. Everyone got the lunch buffet, so this review is only based on that since we didn&#39;t try anything from the menu.<br><br>The selection is small, but all of the food is made with high quality ingredients.  There was a few simple sushi rolls, soups, curries, salads, noodles, shrimp chips, and other things as well.  A favorite of mine was the tuna tartare that was presented in a little ball and had a spicy sauce. The deserts were presented nicely; there were various chocolate mouses, pumpkin and coconut flan, and different kinds of exotic fruit, such as dragon fruit and passion fruit. <br><br>The buffet is priced at about €27 per person, which may seem a bit pricey but I thought it was worth it. The service was friendly, but a tad on the slower side. I suggest coming here for a nice yet casual lunch.",
