"categorystrlist":"German,         Bavarian",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/mijMJwOBm3bPukfNZCue5g/l.jpg",
"rating":"3.5",
"reviewcomment":"For Gemuetlichkeit in the center of the city, without all the &#34;Disney-like&#34; atmosphere of the Hofbrauhaus, this a great place to go. The food is really of high quality. No slap-it-on-the-plate here. The location is amazing; if you can manage to snag a seat on the second floor and front of the building, you have a beautiful view of the Operaplatz glittering in the night. Other rooms are less atmospheric, but still comfy.<br><br>The food is amazing. A large menu of classic Bavarian and Austrian grub, but truly well prepared. I had a Tafelspitz that nearly melted in my mouth. The Schweinesbraten and Schnitzel looked nearly as good. Just one thing: this place is damn expensive. 27 euro for a schnitzel? Yeah, you&#39;re paying for location and the name. Worth it if you&#39;re out for a group of colleagues, but chances are there&#39;s something just as good and a quarter of the price down the street. <br><br>All in all, great gemuetchkeit and delicious food... if you got the bank for it.",
