"reviewcomment":"Vits Kaffee is a third wave coffee and roastery shop and makes the BEST Cappuccino in town! I&#39;ve been living in Munich for a year and I&#39;ve been on the lookout for a great Cappuccino for a while until I stumbled upon Vits. It&#39;s a great place to sit read have sandwiches and coffee, I love their grilled mozzarella and tomato panini and their lunch Thai chicken curry is absolutely delicious. Love this place, quite spacious and luminous. <br><br>Very friendly staff and very knowledgeable about all things coffee, they roast their own beans and you can buy some too. They even offer several barista training seminars that are on their website. I took the latte art class with Andrew, he&#39;s awesome and a great instructor. I can&#39;t wait to buy a real espresso machine. Awesome cafe!",
