"categorystrlist":"Arabian,         Lebanese",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/FIZo31i_XHis4yZl1_RBog/l.jpg",
"rating":"4.5",
"reviewcomment":"Yummmmmmmmmm!!<br><br>This was my second time at Sababa, and I have to say I was not disappointed. The first time I went I had the falafel teller, but this time I tried the shwarma teller. Both plates were really, REALLY tasty. <br><br>Sababa is a hidden gem, that a lot of people seem to know about - because it is pretty much always packed during lunch time. The prices are decent, and the portions are lean towards the large side - therefore it is a pretty good deal for the Viktualienmarkt. Although I don&#39;t remember what the falafel plate cost, the schwarma plate cost 7.90. The plate came with hummus, baba ganoush, salad, various pickled items, delicious pita bread, and a very large portion of the schwarma meat. <br><br>I know some people may think that shwarma meat can look like the indistinguishable parts of the animal. However, this shwarma consisted of large chunks of turkey breast - no mystery meat on this plate! ;)<br><br>I would recommend this place to anyone. In fact, everyone should go check this place out. Enjoy :).",
