"reviewcomment":"Alternative and fun. No reservations and pay by cash only (nearest bank is by Isartor around a 5 minute walk). <br><br>Food is fantastic! Ordered a spicy carrot soup and the shrimp and calamari salad. Food was the best I have had in Munich, very filling and absolutely delicious! It was all too much to finish, the salad would definitely have been enough. My boyfriend had the chicken with chickpeas, sun dried tomatoes and mint and he loved his as well. Both were washed down with beers. <br><br>Dinner was 30€ total for both, very reasonable for the high quality food and way the chicken is sourced (comes from a local person).<br><br>I would most definitely recommend even for non-salad eaters (I almost never order a salad when I eat out). Something there for everyone. Plan to go back again if ever in Munich!",
