"reviewcomment":"This is one of the places where we like to bring our out-of-town guests. The restaurant has plenty of Bavarian flair combined with an extensive, creative menu and brewery-fresh beer. It is big enough and just-outside-the-city-center enough to have tables available most evenings without a reservation. <br><br>The beer garden is also one of my favorites. On a sunny summer day, the more central biergartens are often crowded to the point of being unpleasant, whereas Nockherberg is usually lively but still has room for us to find a comfortable table. <br><br>For tourists looking for some Munich flavor off the beaten tourist path, I&#39;d easily recommend a stop at Nockherberg.",
