"categorystrlist":"Vietnamese",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/iEEWKHtY0h8UDv-8VLwvag/l.jpg",
"rating":"4.5",
"reviewcomment":"Fabulous Vietnamese for a reasonable price.  We stumbled into this place after the poor experience down the road and as it happened they had a table for four free. <br><br>It seems like a small family restaurant and the service is polite, prompt and friendly. They also have English menus which was a plus as one of our group did not understand German. <br><br>I had the fresh wrapped spring roll with beef for starter and they were fabulous. Nice spicy beef wrapped in fresh vegetables and wrapped in a nice rice paper roll with a yummy dipping sauce....sher lecker.<br><br>For main I had the Pho Cari - extra Scharf :-) and it was delicious sauce with coconut milk, lots of vegetable and chicken and nice noodles. I also tried some of the other dishes and loved them all. Even the dessert of banana tapioca pudding &amp; banana fritters was great.<br><br>This was the first time I have been to a Vietnamese restaurant in Munich. Having been to hundreds of Vietnamese restaurants across many other countries in the past I would rate this place pretty high for quality, flavour and value for money.  <br><br>Will definitely return here again and again :-))",
