"rating":"3.5",
"reviewcomment":"I recently went to this restaurant for my boyfriend&#39;s birthday. I must say, I was pleasantly surprised. Not only does The Big Easy offer baby back barbecued ribs, but  the barbecue sauce tasted like real (American) barbecue sauce - I think it is important to note that good barbecue sauce is very difficult to find around here.  <br><br>My boyfriend got the Jambalaya which was spicy and delicious, and our friend got a bison burger which was juicy and tender. <br><br>Initially we wanted to come here because they advertised live jazz... however the jazz was just a person singing along with a kareoke tape (or at least that is what it sounded like). Our waiter assured us that the jazz is actually better on Sundays, but we haven&#39;t been back to see if what he said is true. <br><br>The food is a little pricey but the quality is good. The cocktails are delicious, and it looked as though they had a good happy hour deal! I would definitely go back to this place.",
