"reviewcomment":"Este informe es de un viejo viaje. ¿Alimento mexicano con la cerveza bávara, qué más usted quieren? Por supuesto, prefiero la tuba ruidosa del mariachi comparada a la tuba bávara ruidosa, pero ésta no es la esquina de Avenida Revulocion en Tijuana, Baja California. <br><br>Roughly translated, this old trip report was when I was taken here by our Munich coworkers. Mexican food with Bavarian beer? What more do you want. OK, it&#39;s not the corner of Avenida Revolución y Calle Segunda in downtown Tijuana, but hey, the Bavarian tuba on Leopoldstrasse can be just as loud as the Mariachi tuba on Avenida Revolución. <br><br>Tijuana has had a reputation of being one of the best Mexican places in Munich, according to my deutschen freunde. The cocktails, and the food were all great. It was not a Spanish speaking crowd, but after a few cactus juices, the Bavarian-accented German language sounded like Baja-Californian Espanol. I&#39;m glad our German colleagues took us here.",
