"reviewcomment":"My favourite Thai cafe for quick, reasonable and tasty food cooked by Thai ladies :-))<br><br>I eat at their OEZ branch quite regularly and love the food. They use good quality ingredients and use very little or no pok choy or other such filler vegetables that you often find in Thai dishes. <br><br>I have not had a bad meal here and have tried their daily specials on numerous occasions and they are usually good. If you like spicy they can make it so and also give you plenty of chilly sauce choices you can add to your meal.<br><br>They also serve mango lassi at this place that is divine as is the Ingwer tee (ginger tea)<br><br>I go here quite often and see no reason to change :-)",
