"rating":"4.5",
"reviewcomment":"Some of the most authentic ramen I&#39;ve had outside of Japan. Takumi seems very popular with Japanese visitors and expats as well. Great selection of ramen. The shiyo ramen is my personal favorite, but the miso ramen is also excellent. IMHO it&#39;s also a good sign they don&#39;t try to do sushi to lure in more people. They don&#39;t need to; they specialize in ramen and do that very, very well.<br><br>Try the gyoza, they&#39;re so good!<br><br>They also have a nice selection of small plates that aren&#39;t easy to find in most Japanese restaurants, such as ikura (salmon roe) served over warm sticky rice with a sheet of seaweed. It&#39;s sort of like a deconstructed onigiri. <br><br>Small selection of popular Japanese beer too.<br><br>It can get very busy even on weeknights, so be prepared to wait.",
