"rating":"4.0",
"reviewcomment":"Marais converts the cafe experience into a thing of beauty.  Every view from every angle of this place is aesthetically pleasing.  Heck, *I* feel beautiful when I walk out of this place.<br><br>The chai is homemade and DELICIOUS.<br><br>The cakes are fine specimens of the baking arts...and are DELICIOUS.<br><br>Panini - DELICIOUS.<br><br>Coffee - DELICIOUS.  They must have some very high quality espresso machines, because the coffee comes out so rich and creamy.<br><br>It seems that every item in this place is for sale.  So if you like your table, or chair, or the whole set, or the dishware, ask the service what it would cost to take it home.  However, do not ask the service how much to take them home.  I don&#39;t think they operate THAT kind of establishment.<br><br>The bathroom is a journey back to 1913, but in a cute, nostalgic way.  You&#39;ll see what I mean.<br><br>The only drawback about this place is the lack of wifi.  But hey - maybe it&#39;s better to come here to unwind and unplug anyway.  That coffee and cake sure deserve your undivided attention...",
