"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/IqZI0-n7mNPhXxp6ejJPFg/l.jpg",
"rating":"3.0",
"reviewcomment":"I&#39;ve been here a couple of times now and I really like this place. It&#39;s a fun place to go for something a little different! <br>It&#39;s worth getting the all you can eat option and taking your time since there are a lot of different meats and flavour combinations to try &amp; it&#39;s only a couple of Euro more expensive.  <br>Every time I&#39;ve been there the waiters have been really nice and helpful and always willing to speak English.  The bartenders are especially nice &amp; happy to make your cocktail super strong if you like!  <br>You basically have to accept that your night out is going to be a little on the expensive side since the cocktails and wines aren&#39;t cheap but I would say they&#39;re definitely worth it. <br>Make sure and reserve ahead of time too since they book up fast and they only run two sittings on weekend nights - although if you want to eat at 5.30pm and be out of there by 7.30pm that&#39;s not so much of a problem!",
