"rating":"3.5",
"reviewcomment":"My sister was getting cranky and I was getting tired of walking around so, we ended up at this restaurant since it was in front of us eventhough we wanted German food. We paid for it alright.<br><br>I&#39;ve seen this restaurant all over Germany. They seemed busy so we thought that maybe this place was good. Wrong!<br><br>Maredo Grill Skewer:<br>Rump steak, onions and peppers served with fries, herb butter and Papa Asada with sour cream. With all these things going on in my plate, how come there was no flavor? I tend to avoid salt but I found myself with the salt shaker in hand.<br><br>Rib-Eye:<br>Very tiny piece of meat. It had no flavor. <br><br>Salad Buffet:<br>This is the only good thing they had going on. This is because you can get your own food without having to wait for your server. The selection of veggies, dressings and toppings were pretty good.<br><br>This place is comparable to Chilli&#39;s or Applebee&#39;s with horrible service and worse food but you pay about 15% more. Our server kept forgetting what we haven&#39;t placed our order, kept forgetting what we ordered and kept forgetting o give us the check. Stay away even if you&#39;re starving to death.",
