"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/BRikE6hlOUHRzyAt1-6cYg/l.jpg",
"rating":"4.0",
"reviewcomment":"El Gordo Loco now has the honor of being placed on my &#34;Good Mexican Restaurants in Munich&#34; list. <br><br>I went there with a group of 10 on a moderately busy night. There was also another large group, so I wasn&#39;t expecting quick service. However, that wasn&#39;t the case. I was amazed how quickly we received our drinks, appetizers, entrees, rounds of shots, etc. The staff made it look effortless AND still had time to stand around and talk. I don&#39;t know what they&#39;ve figured out when it comes to efficient service, but I wish they would share the secret with other restaurants around the city.<br><br>The drink menu doesn&#39;t include much that you haven&#39;t probably already seen before, but they are still made well and certainly not lacking in the alcohol department. Expect the standard Munich prices here. As for the appetizers, here is where I must dock El Gordo Loco one star. Eight euros for some chips and guacamole dip?....SERIOUSLY?! The price combined with the not-so good chips (they tasted stale in my opinion) is really just not worth it. I also ordered the dates wrapped in bacon(.....don&#39;t judge me...I was super hungry haha). Yet another disappointment. I only received 6 dates on the plate and two of them were TINY. To compensate for the plate being otherwise empty, there is a huge mound of salad in the middle.That&#39;s an okay trade-off right?<br><br>My dinner was the empanadas that are listed in the restaurants &#34;specialties&#34; section of their menu. I hope nobody was watching me eat this, because I probably looked disgusting with how fast I ate it....it was seriously that good. I was almost (key word...ALMOST) embarrassed about how clean my plate was. I thought they tasted authentic, and that&#39;s basically what I want when I&#39;m craving Mexican food.<br><br>Two thumbs up, aside from the appetizer menu that just didn&#39;t really float my boat. Overall, I think you should check it out!",
"reviewcount":"43",
"pricelevel":"€€",
