"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/FfdFe7aDGoai7RUBYUiDfw/l.jpg",
"rating":"3.5",
"reviewcomment":"Super busy! But we got a table right away and without a reservation. The menu has so many things good things on it, so picking one thing is really hard. We ordered the special  coleslaw (with bacon!) and the mixed platters. It took some time for the food to arrive, but not too long.<br><br>The salad was great, there is definitely a difference between the German coleslaw and theirs. We had one small and one big plate of it. The big plate was 1 pound of salad!<br><br>After that we got our main dishes. Soooo good. Remembered me of my childhood days. A huge plate, with freshly cooked food. Sausages, skewers, chicken, beef, pork, Ayvar, fries, slaw, sour cream,... It was delicious, and way too much!<br><br>All of us enjoyed the meal! Great atmosphere, brewery-like. The location is very convenient (3 minutes from Marienplatz), and the prices are awesome. A main dish costs around 13€, drinks 3-4€!!!<br><br>Check it out!!!!!!!",
