"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/8_95jMQ9gMks0HKfKey_6g/l.jpg",
"rating":"4.5",
"reviewcomment":"World-class restaurant with everything you&#39;d expect: high end service, high end prices, and high end ingredients. I had the 5 course tasting menu which was more than enough and they were nice about doing only a few glasses of wine (which were excellently paired) instead of the full wine tasting. <br><br>They are strict about dress code -- they turned away a european couple in front of me who had capri pants on. They did let me in with jeans but I did have a jacket and dress shirt.<br><br>They were great about accommodating food allergies and overall with anything you asked. I&#39;d say the only minor quibble I had if I had to compare them to someplace like Jean George is that when they served the meals, there wasn&#39;t much fanfare. They didn&#39;t have multiple servers unveil/deliver the plates at once and they didn&#39;t talk through what you&#39;re eating. That said, that isn&#39;t a big deal and I still had an amazing time here.",
