"reviewcomment":"Stopped here this past Sunday for an afternoon coffee before dropping a friend off at the Hauptbahnhof and WOW CAN THESE FOLKS MAKE SOME CAKE!<br><br>The kind of cake that makes you exclaim WOW before you can regain control of your body.<br><br>The kind of cake that makes you wonder whether the cake really was content just to lie on your tongue, titillating your palate, whether you just imagined its moist, spongy goodness reaching into your heart to become a part of your soul.  I am talking about you, Lemon Cake, you minx.<br><br>Also, I have it on good authority (from a Münchnerkindl) that this place is also nicer than it used to be.  A soothing living room feel makes everyone at home here, whether they be twentysomethings, young parents, or civically minded folks of any age wishing to gab about local politics and health news over a cuppa joe.<br><br>During the winter months, I highly recommend trying the winter teas that they offer, and in particular the Apfel-Holundersaftschorle.",
