"reviewcomment":"Don&#39;t eat the burgers.<br><br>But the Münchner Schnitzel - with mustard and horseradish incorporated into the breading - is highly recommendable.  For a true Münchner experience, pair that with a Schnitt or five.<br><br>I come here when there is an event or meeting a group.  With the extra large tables tat are easily moved together, and the compartmentalization of this place, it really lends itself to hosting big groups.<br><br>Otherwise, I tend to avoid this place because I&#39;m not a fan of Löwenbräu Helles, and while I do like Franziskaner Weißbier, I&#39;m just not a big Weißbier drinker (outside of a Münchner Weißwurst Frühstück).",
