"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/OfmfcfZGPycQnUgMkQKgGQ/l.jpg",
"rating":"4.0",
"reviewcomment":"Ahhh yes, yet another place I can see myself going to again. Win!<br><br>Alter Simpl is one of those bars that looks like it&#39;s been around forever.....because it has! Previously the &#34;go to&#34; place for artists and people of that sort, now it is home to a fun mix of everyone (but mainly students). I was there on a Saturday night and though it was busy, the staff remained friendly and other guests didn&#39;t seem to mind shuffling around so you could find yourself a nice spot. I couldn&#39;t help but laugh when I turned around and saw a couple (possibly in their late 60&#39;s) both reading their newspapers while gulping down their beers. It just emphasized to me that this really is a place for everyone. The atmosphere is great and I love how the owners have not tried to restore anything. <br><br>I&#39;ll definitely make a stop here for drinks the next time I go out for dinner in the University area : )",
