"rating":"4.5",
"reviewcomment":"A friend took me to this place for a tea and it&#39;s all good! <br>I love tea time in general and all the atmosphere that is linked to it. <br>I can say that this place is a peaceful heaven for the 3 times I went there for a tea. The decor is japanese inspired: wood and pale colours. Different kind of tables, seats are available and also a terrace when the weather is nice!<br>My only cold comment would be about the service on the terrace. When it is crowded you may have to go to the counter to order, but in general the waiters are nice.<br><br>Now about the taste experience: I only went there for tea and cakes but I saw some other tables ordering some main dishes. They look very healthy and maybe i will try one the next time.<br><br>Teas are quite expensive, but they have a very nice Matcha that you don&#39;t find everywhere else. Also, I try a green tea and a fruity one: I wasn&#39;t disappointed! It was very good.<br>The cakes are just divine!! Seriously, I didn&#39;t know that vegan cakes could be that good.<br><br>The plus: You can buy some porcelain cups and bags of tea directly there.",
