"reviewcomment":"This place hit the spot after a late night at work. I had the Penang curry w/organic turkey breast, which was delicious. The serving was super generous, although you pay a bit more than you would at neighboring Dean and David&#39;s, it was worth it in my opinion. <br><br>The spices at table were also nice and added a pleasant kick to my curry (even though the menu said it was &#34;scharf&#34;). Apparently german&#39;s have a different tolerance for spicyness. My friend was not too happy when I told him the red pepper sauce was &#34;a little spicy&#34;.<br><br>I think some people next to us had the Pad Thai, which also looked great, something I&#39;m looking forward to trying next time (soon!)",
