"reviewcomment":"In the heart of the city -- literally and figuratively -- you&#39;ll find one of the most popular biergartens in town. This tiny oasis of suds in plop in the middle of the Viktualienmarkt, Munich&#39;s huge outdoor market.<br><br>The great thing about the biergarten here is that it&#39;s the perfect place to stop in for a nice lunch, whether you&#39;re shopping, skipping away from work for a quick bite or in town visiting. And the truly unique part is that since the biergarten is owned by the government, they don&#39;t just serve one brand of brew, but actually alternate daily/weekly between Munich&#39;s big six, making it the best place to sample the different specialties while munching on local Bavarian grub or bringing some snacks from the surrounding market.",
