"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/NszzDii4MRma-m_vqRRIrw/l.jpg",
"rating":"3.5",
"reviewcomment":"This is one of those typical traditional Bavarian restaurants in Munich. It was my first time here. Came on a Friday at around 2 p.m. <br>Place was still packed, had to go to the first floor to get a table.<br>Setting is rustic, which is what you expect. Service is prompt and very friendly.  Atmosphere is very lively and you hear a lot of different languages, which makes this place quite international.<br>Extensive selection of different beers and liquors with the emphasis on Bavaria and Germany.<br>Food selection include all those Bavarian classics which you could imagine.<br>We opted for beef goulash with spatzle, the beef tender, juicy and well seasoned. The other dish we had was baked calfs head with potato and cucumber salad. The meat was very tender, almost melting in your mouth. It was the first time for me but I have to say that I liked it very much and can only recommend it even the dish might sound a little adventurous.<br>All in all, good value for money! Definitely will come back.",
