"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/kKajZdvROOuRmpdZ7Scy8A/l.jpg",
"rating":"3.5",
"reviewcomment":"Had a fun dinner here. Closed a deal and went with the team here to celebrate. Was first super skeptical about a Greek place suppossedly being trendy and an &#34;in-location&#34;. Wasn&#39;t disappointed. Sat next to Lehman, the soccer goalie....didn&#39;t have a clue who he was but my German colleagues pointed this out. Anyway, the place was somewhat full around 8pm when we arrived. By 10pm it was packed. I found the staff to be really nice and attentive. Typical boisterous Greeks but in a good way. Further, I found the food to be very good. It wasn&#39;t gourmet food but very good. Most of us had seafood and one of my colleagues even commented that it was the best calamari that he ever had. I had the swordfish and was quite pleased with the dish. The restaurant has a great (large) outdoor area and a nice interior indoors. I had a good time and and found the best part of this place to be the prices. It was surprisingly fair in regards to status of this place, location and what you get. I&#39;ll probably be back at some point. I&#39;d come more for the food than the crowd though. I&#39;m not into the &#34;see and be seen&#34; crowd and this is definitely a magnet for them. Make that decision before you come if that&#39;s not your thing.",
