"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/VxO0oYVGz65bsEx4A0cxUQ/l.jpg",
"rating":"2.5",
"reviewcomment":"Visited this place with a gathering for &#39;Monday after works&#39; party. As this place again is close to my place, I really wanted to visit it. At first hand, I was impressed to see the amount of space this restaurant has got. Not like typical restaurants, where they defy every conventional logic and try to utilize every inch of space into a meaningful spot for extra bucks (which is not bad, but at times it looses its aesthetics when it gets crowded). So, yeah the place is quite spacious. Apparently also I am being told this is a prefect spot to hang out for football matches which I realized when I saw at least 3 large LCD&#39;s hanging out in three different sections of the restaurant. I was told during champions league and other high octane football matches its jam packed. So thus this place, definately gets additional points for sports lovers like me. <br><br>Coming to food, they are pretty decent. Not so bad, and not so &#39;muaaah&#39; out of the world too... Price front they are not expensive at all. My friends tried various forms of burgers and salads which they liked pretty much. Cant say much about food, as in my first visit I had very little delicacies. <br><br>Overall, A fun place to hangout with a group and specially when you want to watch a match not in your living room. Will surely visit again.",
