"reviewcomment":"This has gone to the top of my ALL-TIME FAVORITE RESTAURANTS EVER.<br><br>This is a trendy restaurant that is known for their use of interesting (sometimes strange) combination of flavors and foods that come together to make a harmonious and delectable dish. They also have a different menu every night, which is good because it indicates the ingredients are fresh! The atmosphere is very modern and chic, yet the servers wear jeans and a button down shirt with rolled up sleeves. The menu is divided into categories with a few dishes in each. There is an option to have anywhere from 3-7 courses. I decided to go with 4 courses. Since I don&#39;t eat meat, I was apprehensive on what to order. However, they are were very accommodating and told me that whatever I ordered would only contain seafood or vegetables, and in place of the meat would be something different. I wasn&#39;t 100% sure of all of the ingredients being that the menu was in German, but I decided to order the vanilla scallops, eel ravioli, fish with a pineapple and shiitake saute, and chocolate mouse. (Refer to pictures).<br><br>I could go on and on describing the incredible dining experience I had here, but I&#39;ll spare you the pages and pages of detail. All of the courses were perfectly cooked and the flavor combinations went surprisingly well together! One thing I noticed was that they tend to under cook their protein, so if you&#39;re picky about that you might want to tell them how you&#39;d like your meat/seafood to be cooked.<br><br>While the service was friendly, the courses came out very slowly. This isn&#39;t a problem when you&#39;re not in a hurry and want to enjoy each tasting. Just a heads up to expect to be here for at least 2+ hours depending on what you get.<br><br>GO HERE!",
