"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/I07qtSnNf-y7xrVrzEMGpw/l.jpg",
"rating":"4.0",
"reviewcomment":"The service here is excellent - friendly, well-timed, happy to give advice and you never have to wait long for anything, whether it be food, drinks, or another drink order.  We have been here many times over the past few years and we have never been disappointed, except for the couple of times when it was so busy we couldn&#39;t get a table.  Reservations are highly reccomended!  <br><br>You get a round of ouzo for the table when you arrive and also when you leave, on the house.  In addition, you also get a plate of fresh fruit with vanilla ice-cream at the end of the meal.  The food itself is fresh and well prepared - the meze are delicious as are all of the meat platters, and unlike in some places, the meat is never dry and leathery.  I&#39;m told that the fish soup is excellent as well. <br><br>My only caveat is that  I personally would prefer not to get the small mound rice with tomato sauce on it with the platters, but I am not generally a fan of long grain white rice with butter anyhow and since I always forget to ask for a substitute, I can&#39;t say what else one might get instead.",
