"reviewcomment":"Inside is very spacious and the terrace outside is also large. Obviously it&#39;s difficult to find an outside seat when the weather is nice. <br><br>Before I ordered my partner said that the breads/sandwiches/baguettes are usually rather thick and the spread is spread on rather thinly. So that was the mindset before ordering. <br><br>When my 1/2 baguette with tuna salad arrived, it looked like my partner was right. The spread seamed to be spread on like they were running out and had to make it last a few more orders. <br><br>However! The baguette tasted really nice! I squeezed the lemon part out over the spread which gave it a nice sour twang. The amount of bread and spread turned out to be perfect! The salad was very tasty. The small pieces of gherkin were nice. <br><br>The bread was also very nice. <br><br>At first glance the amount of cheese seemed a bit small, but in reality it turned out to be just right. Often you get a &#39;tuna melt&#39; or something similar with just to much cheese on top so the sandwich doesn&#39;t only get very fatty but the tuna taste also gets drowned in the cheese.<br><br>I was trying to compare this baguette with my fav tuna sandwich in Amsterdam, but both are great, simply different. <br><br>The oriental platter was okay, humous was nice but the rest wasn&#39;t to my personal preferences. <br><br>Gärntnerplatz is easily becoming one of my favourite Munich hangouts.",
