"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/edl2wJZHsmA3NOc4O0hwkg/l.jpg",
"rating":"4.5",
"reviewcomment":"Next time you are near Goetheplatz round lunch time don&#39;t take the easy way and go to the McD. on-site. Better head down Lindwurmstrasse a couple of meters to enjoy a hearty meal to go at this quirky Austrian takeaway. You will get no more than one of the best sandwiches in town! The so called &#34;Grillfleischsandwich&#34; is most likely comparable to a kebab. Plenty of tasty grilled meat, some tomato cubes, a handful of chopped onions and the mega delicious secret sauce sensation &#34;Jahrhundertsauce&#34; &#39;century sauce&#39; !!! This is soul food at its best! And the portion is huge, it will keep you stuffed for hours. The gentleman also sells delicate Salzburger Bosna sausages, those are highly recommended as well. There are two idyllic places nearby where you can enjoy the meaty treats best alongside an ice cold coke on warm summer days: The calming Alter Südfriedhof (Old South Cemetery) and the famous Theresienwiese.",
