"rating":"4.0",
"reviewcomment":"A friend of mine in Munich suggested we try this place for dinner and I was so glad she did. This place is excellent. <br><br>The food is great the place is packed the atmosphere is good and the service is excellent. What more can you ask for ?<br><br>I had the chickpea soup with pancetta to start and had the saffron risotto with saltimboca for main. Both were excellent and the flavours were intense and divine. <br><br>The wine selection was excellent and the wine we chose was exceptionally good and we ended up getting through two bottles of it :-))<br><br>Desserts were a disappointment and that&#39;s a real shame. Am beginning to realize that dessert is not a German thing at dinner time and therefore probably not a thing people pay a whole lot of attention to :-( <br><br>All in all a great experience and I will defenitely come back here :-)",
