"categorystrlist":"Pizza,         Italian",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/WVhf0w4YpxODYjVDsDh2Xw/l.jpg",
"rating":"4.0",
"reviewcomment":"It&#39;s not the greatest pizza in Munich (I&#39;ve not yet found that!) but this is a good place to get a quick lunch - a slice of decent pizza.  It&#39;s almost more of a flatbread - thin crust, good texture though, not dry and cracker-like.  Toppings are fresh and well chosen.  <br><br>The order/service process was a little confusing - there may have been table-service but it was not clear.  We just picked out what slice of pizza we wanted at the counter, then the guy popped it in the oven to warm.  Then he motioned us towards the bar to grab a beverage out of the fridge (told us it was self-service) - we had a seat and then he brought us the pizza.  Looks like it&#39;s possible to get it to go too.  <br><br>The whole process was pretty fast (for Munich) and not expensive (pizza slice was maybe €2.70?). We only needed one slice each; if you&#39;re famished you could eat 2 pretty easily.",
