"reviewcomment":"Vapiano: sounds italian, serves italian dishes... but if you want to eat italian better go elsewhere.<br><br>Vapiano looks really nice from outside and from inside, quite luxury in reality. At the entrance you receive a card and everything you take is charged on it, so you can pay at the exit. Even if you take only a coffee at the bar, that what I have done.<br><br>Ok, the espresso was good, however making it is as hard as pushing a button on the coffee machine. But I take advantage of this to see it and I must say, Vapiano is much much much more nearer a fast food than a real restaurant. And looking at their pizza, I&#39;d rather go to eat in a full-american Pizza Hut than there.<br><br>Nothing else to add, I&#39;m really disappointed of so-called restaurants that use a name just to appeal.",
