"reviewcomment":"If you&#39;re looking to find a pleasant and stylish breakfast or lunch place with reasonable prices in a high-end shopping area, Caffe Florian is definitely your place. Set in one of my favorite neighborhoods in the heart of Schwabing, this place has a nice fin-de-siecle feel to it - like a Belgian brasserie with waiters and waitresses in white aprons, wooden panelling and shining brass. But it also feels modern with its stylish light yellow wall and modern photographs.<br><br> Lots of salads and light fare with clear Italian influence, good housewines and coffee. Not a top restaurant - it&#39;s a caffe, remember - but price/quality wise, it deserves my 4 stars.<br><br> But it can get noisy here! There is a bar in the cellar, but I&#39;ve never been.",
