"rating":"3.5",
"reviewcomment":"Tapas bar with a small inside but nice outdoor seating. We got a half liter of sangria (delicious and I love that it comes in a half liter!) and then we spent some time considering the menu. They didn&#39;t have an English version, but the German one had all the names of the dishes in Spanish, so we could work through that, sort of. The waitress was also extremely nice and spoke English and offered to help us with the menu.<br><br>Instead we ended up getting the dinner for two, which was amazing. It came with a hot plate and cold plate which altogether had enough food for four people. The cold plate had maybe 10 different dishes, and the hotplate had four (stuff peppers, something deep fried, sardines and potatoes with red sauce). And they were all really good. We could not finish it!<br><br>We read the menu wrong - we thought it was 19 euros for the meal but actually it was 19 euros per person, or per hot/cold. I don&#39;t know. Oh German.<br><br>But, great service, great food, great drink. Thanks!",
