"rating":"4.0",
"reviewcomment":"Wow. what a nice and good Thai restaurant. hidden in an old part of Munich, in Laim. Parking can be a bit challenging, but with public transportation pretty easy to get there, take the underground to station Laimer Platz, then its just a five minutes walk.<br>But now for the restaurant: we went there with our Thai-friends as they wanted to have some asian food again after all that bavarian and german cuisine.<br>Service was very warm and friendly, good that we had reserved a table (as it is a quite small restaurant, maybe 30 seats)<br>We did it the Thai-way: ordered just some 7-8 dishes and shared. all of them were very nice! If you want it a bit more spicy than the european style, just tell them (usually they take one red chilly for the som tum, 3 were good and spicy without killing us :-)<br>Our Thai-friends were more than happy about the food and the service, we as well! Will go there again for sure!",
