"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/7WnNRZCpQY0IJ7wt_0rnGA/l.jpg",
"rating":"4.0",
"reviewcomment":"We eat Indian food in almost every country we visit. It is our go-to favorite. <br><br>Natraj was simply a stunning surprise in the caliber of the food and service. It was delicious food with well-balanced flavors served with panache.  The owner did spend quite a bit of time with our table and was a wonderful host. <br><br>I started my meal with a bowl of Dahl -- light, smooth and wonderful. I wanted to have the Lobster Curry but they were out so the owner suggested a special treat with prawns that would be similar. It was quite simply a stunning taste profile -- he explained that they start the dish with an overnight soaking of fenugreek to bring out intense flavor.  I don&#39;t know the name of the dish but it was life changing. The naan was even well flavored. We ended the meal with a mango confection that was light and refreshing. <br><br>If I lived in Munich, this would be MY Indian restaurant.",
