"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/kK0bSg8FEOOeVCKmlZN7uQ/l.jpg",
"rating":"4.5",
"reviewcomment":"Food - 5<br>Service - 5<br>Value - 4<br><br>Ignore every rating below 5 stars. Those reviewers have either never been to Japan or tasted real Japanese food. This is the FIRST time since arriving in Munich that I ate authentic Japanese food. This was not a Vietnamese family masquerading with a half-assed attempt at Japanese cooking seemingly like every other Oriental restaurant in Munich. THIS IS REAL JAPANESE FOOD!!<br><br>My only gripe is that it is a bit pricey for what you get but really, I am not complaining. The takoyaki tastes just like it did on the streets of Tokyo. And the mochi. Oh the mochi! It tastes just like how my family&#39;s Japanese friends make it at home.<br><br>Seriously, if you want real Japanese food, come to this restaurant. The dining area is small so make a reservation.<br><br>Thank you J-Bar!",
