"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/1nYttkMMueP86lwf1bD-Ng/l.jpg",
"rating":"4.0",
"reviewcomment":"This is a lovely restaurant!  The food is excellent, staff is very friendly and the atmosphere is comfortable and welcoming.  I ate at the restaurant last night, and am lucky asparagus is in season because they have a full-blown asparagus menu!  Appetizers, soups, salads, entree&#39;s all featuring white and green asparagus!!<br><br>I had the asparagus salad, with parm cheese, chilli and artichokes.  The asparagus was warm and mixed with chilled greens with lemon and olive oil dressing.  The chilli gave it a nice kick and the parm was the perfect finishing touch!<br><br>I had the asparagus and lobster risotto.  It was a bit on the cheesy side for me, but it was still well done and the portion size was perfect.<br><br>For dessert I had the chocolate molten cake with yogurt flavored ice cream (not frozen yogurt)...it was AMAZING!<br><br>I loved this place and would love to come back.  My only wish is that I could buy the tablecloths and napkins - they were SO cute!",
