"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/ICg8Dgnbn8HRpwhVnTA4BA/l.jpg",
"rating":"3.5",
"reviewcomment":"I happened to walk by this place and from the outside it looks like an ordinary coffee shop and must say, the sign at the shop almost stopped me from stepping in. As with most things I work on the basis of &#34;don&#39;t judge the book by its cover&#34;. <br><br>Once you step inside its a whole different world here. The shop has tons of different coffees and coffee machines on sale and a nice small coffee and food counter. There are seats inside and out.<br><br>The cappuccino here is excellent and comparable to some of the best in town. The Butterbrezn was also excellent and chewy and I loved it. The place was busy as and loads of people waiting in line to order coffee and breakfast. They have a whole selection of sweet and savoury items including sandwiches and other breakfast items. <br><br>This place is self service only and one must order and pay at the counter and pick up your order even if you are staying in. From the amount of people here, I imagine that this is not a problem :-) <br><br>I would happily come back here for a coffee and Butterbrezn again :-))",
