"categorystrlist":"Italian,         Pizza",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/lQ_BzlqahwrgQlLpqhij1g/l.jpg",
"rating":"3.5",
"reviewcomment":"Some 10 years ago this was the best pizzeria in Munich for me and I used to be a regular. It was a tiny place with just 5-6 tables, always full and baking great pizzas in the wood-fired oven.<br><br>Then the place expanded, annexing the restaurant around the corner, changed oven, staff and attitude.<br><br>The quality of the pizza suffered, and everything else too. I come back once a year or so now and every time I&#39;m convinced that there&#39;s much better places in Munich if you wanna spend a night out eating Italian.<br><br>The staff aren&#39;t the most friendly and on a weekend night they really try to fill up the place by squeezing customers together. I was also disappointed with my pizza tonight. I ordered a margherita with extra cherry tomatoes. There was basically no cheese on it and there was ONE, no kidding, ONE cherry tomato on it. I guess I even paid 1,29 extra for the extra topping. LOL<br><br>Still, it&#39;s not a catastrophe, and they do have a nice and quiet outdoor space.",
