"categorystrlist":"Vietnamese",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/lUe9dLEZGTRKsOrPkidsMg/l.jpg",
"rating":"4.0",
"reviewcomment":"I&#39;ll write a review in English for English speakers out there or tourists looking for a nice restaurant a bit out of the main drag.<br><br> Since discovering MAI in the Klenzestrasse a few years ago, it&#39;s become one of my favorite restaurants in Munich. What&#39;s more? It&#39;s one of the very few restaurants open until 3am! You can&#39;t get everything on the menu after midnight but you can order big vietnamese soups up to 3am. They are to-die-for and Canh Chua Do Bien is my favorite of the big soups. To order a soup as a starter, try Canh chua tôm. Both are a little spicy but if you can take it, you&#39;ll thank me for it.<br><br> Last but not least, the service (which may be slow when packed) is very good. The staff is very friendly and you get crab chips/cakes with your drink plus plum wine at the end as a thank you. This is significant because no other vietnamese restaurant I&#39;ve visited in Munich does that. I&#39;ve saved you time by visiting a few and MAI is hands down the best. Pity it&#39;s not always as full as it should be.",
