"rating":"4.0",
"reviewcomment":"La Bouche is a charming small French Restaurant offering delicious cuisine in Munich; they have a wide selection of dishes offering a gourmet food or a set daily meal. I am not an admirer of Crème brûlée but here it is really delicious. For Munich prices, it not really expensive, starters from EUR3.50 - EUR8.00 / main Dishes from EUR15.50 - EUR19.00 or the daily set menu for a three course is EUR23.95. They use a lot of fresh ingredients and they cook in a way which is unique.<br><br> The food is delicious; the staff are very nice and really helpful.<br><br> I personally don&#39;t like sitting inside as it is really small and very cramped, you&#39;re almost sitting on your neighbours lap. For me personally, it is too close for comfort plus they have no air conditioning therefore it is extremely hot and the heat from the kitchen doesn&#39;t help, there is basically no air flow.<br><br> They offer outdoor seating on the street during hot summer months, so I recommend reserving one of these tables.",
