"reviewcomment":"Wonderful wonderful wonderful! This is by far the best Vietnamese restaurant in Munich. You may not think it for the outside but it is absolutely amazing! We were introduced to it by friends about 3 months ago and have been back almost in a weekly basis ever since! <br>The owner is the loveliest, friendliest restaurant owner in Munich and will tell you everything you want to know about Vietnam and the food and culture! <br>She is also excellent at giving recommendations and helping you decide what to eat. I have eaten so many different things from the menu and have never been even slightly disappointed! My absolute favorite is the papaya salad as a starter....for me there are no words to describe how tasty it is! One of my all time favorite restaurants in Munich!!!",
