"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/bhQug7lI7PIz9GCqIu_6-A/l.jpg",
"rating":"4.0",
"reviewcomment":"I and a friend stumbled upon Warmi while looking for a lunch place. From the outside, it kind of looks like what I imagine a Japanese noodle shop to look like. It has the Japanese illustrations, etc. out front. Inside is same. Also, there were already a number of people there at 11:30 on a Monday. <br><br>The lady who waited on us was, I assume, the owner or wife of the owner. She was very friendly and attentive. Prices were very reasonable and the menu, easy to read and well organized.<br><br>We both ordered soup of various types. My buddy ordered chicken and I a seafood. Both were in a large bowl, really well prepared and just the right temperature for my taste. On the table were a few condiments to &#39;spice up&#39; your food, if you felt the need. <br><br>My buddy just kept saying... &#34;Man, this is great!&#34;. In the end, I think I paid 22 Euros, with a good tip for the two of us. If I&#39;m ever in the area again I&#39;ll definitely go back as I was happily full the rest of the day.",
