"rating":"3.5",
"reviewcomment":"Damn this one rocks. It&#39;s quite rare to find such a unique and different place in Munich. Man we have a Rock&#39;n&#39;Roll Pizzeria, how cool is that? Ever imagined to sit in a Pizzeria, enjoying a lovely Pizza to the sound of Ozzy and Motörhead? Well here you go! They managed to keep some nice things Italian restaurants  usually have like the charming checkered tablecloths while they ditched the annoying racket most Pizzerias select as their background music. Instead you will hear everything from Punk, through to Alternative, Indie right up to some kick as Metal and bouncing Hard Rock. On weekends a DJ cares for the musical entertainment.<br><br>Ok lets not forget to talk about the main actor here. The Pizzas are juicy and taste just great. I am a Pizza lover and eat lots of &#39;em, so trust me on this ;)<br><br>A cool add-on: They provide you with fantastic chili and garlic oil. Drizzle that all over your Pizza for the real deal. Of course the oils come in Jack Daniels bottles to the table - guess Lemmy would love this place!<br><br>A 5-Star rating goes without saying.",
