"rating":"4.5",
"reviewcomment":"I support entirely to what my fellow mexican below wrote, as a mexican living in Munich this is one of the best mexican places in town. I tried the quesadillas with Pollo Oaxaca (Wahaka) and Tacos of Carnitas D.F. and i must say the carnitas were almost done as in Mexico City and the pollo Wahaka was really tasty.<br><br>I can&#39;t say it is exactly like what we are used to have in Mexico (that would be indeed very hard to achieve) but they get really close to that and it is definitely worth a visit!<br><br>I got just a bit disappointed about the salsas that are available on the table... The green one is okay but the red one tastes like Valentina (if you&#39;ve been to Mexico you know what I&#39;m talking about) and personally I don&#39;t feel like it goes along with the tacos.",
