"rating":"4.0",
"reviewcomment":"My first German Biergarten experience.  This place was bustling on a Thursday night, and I went with my CouchSurfing hosts for a late night meal and some beers.  <br><br>The food could&#39;ve been a bit fresher, but I was hungry so I didn&#39;t care.  Otherwise, it might&#39;ve made five stars.  The place is under the umbrella of Hofbräu München, so that&#39;s the only beer they serve, albeit many different types.  I had the summer brew and later had a Biermischgetränke - basically beer and lemonade.  Never thought the two would go well together, but very refreshing.<br><br>The clientele was all pretty chipper and happy, but no annoying drunks or overly loud people.  Generally just a really relaxing evening in a beer garden.  Good times.",
