"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/vJsyukHBqXPkaopxVfW47A/l.jpg",
"rating":"4.0",
"reviewcomment":"A block or two north of Isartor tower along the road ringing Munich&#39;s &#34;central&#34; area, this place is easy to miss but a must for all vegetarian visitors to Munich. You will have to make reservations with Ilsa, the owner/chef, who is a sweet soul. She is Austrian, not German, so you will have a chance to sample some truly Austrian deserts...she speaks perfect English ( as with almost all Europeans, especially in Germany, who speak English better than most Americans do) and can explain everything/anything and handle any dietary restriction. She is an EXCELLENT chef...we ate here several times!",
