"reviewcomment":"This one little Italian restaurant, is just next door and I often bump into this place for a quick pizza and a beer. The place has nice ambiance and great staff. They all wear a big smile and greet with enthusiasm - Italian way. quite spacious. Food no doubt is great, and has a true Italian flavor. During summer has a seating arrangement outside, which on a good weather gets filled easily. often crowded by mostly by nearby neighbors and is a place where you will see many regular faces. whenever, I don&#39;t feel like going far for hitting a restaurant, this place often is the savior. on price front its moderately expensive... if gotta chance, do pay a visit...",
