"categorystrlist":"Peruvian,         Cocktail Bars,         Cafes,         Coffee & Tea",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/o-DheyYgzx1zjb2s0fWPBQ/l.jpg",
"rating":"3.5",
"reviewcomment":"We finally made it to this nearby restaurant that we&#39;ve had our eyes on forever, and it was really nice! My &#34;Ceviche tradicional&#34; starter was top notch, and my wife&#39;s deep fried manioc was nice too. As main course I tried the (vegetarian) Quinua, which was very nice, like a risotto but based on a different grain. My wife&#39;s lamb (Seco de cordero) was tasty, though the rice that came with it was a bit dry. The food was accompanied by a Peruvian Syrah, which was not mindblowing but still a nice drink, and slightly exotic. The décor is nice and the service was fine. An easy four stars; hop on the U2 to Theresienstrasse, walk for less than a minute once you&#39;re on the street, and enjoy!",
