"rating":"2.5",
"reviewcomment":"Much like a salmon swimming upstream, I&#39;m going to go against the tide of dreadful English reviews for this place and give it three stars.  <br><br>The caveat is that I didn&#39;t sit and eat, I just got a bratwurst from the guy selling them in the entrance.  For 3 €, I thought I got a pretty good deal.  My bratwurst was juicy and delicious, so much so that I had to be careful eating it because it would squirt bratwurst juice whenever i bit into it.  (I know that sounds kind of gross, but you know what I mean if you&#39;ve ever bitten into a plump sausage).<br><br>Even though I was clearly a tourist (camera around my neck, fanny pack, t-shirt with an American flag on it, etc.)  the guy was nice to me so I just have to call it like I see it.   If you&#39;re getting the Munchen equivalent of a dirty water dog, this is a decent place.",
