"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/v0MEd8BmYswBYKXkb7f_iA/l.jpg",
"rating":"3.5",
"reviewcomment":"Osteria Alpenhof is a great find. a very cool crowd in an up and coming area, both young and old. We&#39;ve eaten there a bunch of times recently and always been happy with the quality of the food. <br><br>A lot of classics, the chef/owner is a German who worked in Rome for a while. The staff is great, friendly and laid back, but very professional. The arugula Salad was large and had a fresh, light, citrus dressing, the antipasti plate was delicious. one of us had a swordfish carpaccio and one of us tried an interesting risotto with cabbage. The Arabbiata was perfectly spicy. Certainly everything was a cut above the usual Italian place in Munich.<br><br>We didn&#39;t try desserts, but had some great wines at very reasonable prices. We have been in once or twice for a drink at their bar and are looking forward to the Terrace in spring. <br><br>There is also a short take out menu we&#39;ve used sometimes later in the evening.<br><br>Definitely recommend this place",
