"rating":"4.0",
"reviewcomment":"This is a very modern place both in food, food display and in the architecture which I thought was good. I also must state that this was the second day Rilano No.6 was opened so that definitely has an impact on them being up to speed.  Overall the food is very good and presentation was top notch. I wasn&#39;t impressed by the flavor of the mushroom cappuccino (very salty and a strong aftertaste) but the presentation was intriguing. The big hang up here is the service. We were seated at 8:30 and it took an hour before they took our order.  An hour and a half into the service and all we had were drinks. Overall it was a 3 hour service and I&#39;m guessing that they lost a lot of money by not turning it efficiently.  However, there were several empty tables so I don&#39;t think it was a huge need to turn tables very quickly.  We  were not the only people waiting much of the night as most of the tables around us seemed to be having the same issue.  Will most likely not return unless service is vastly improved as it was also quite expensive.  All this despite &#34;DJ Hell is in da house&#34; (a quote from the server).",
