"reviewcomment":"Das Essen ist schnell fertig und schmeckt wirklich gut. Gemüse ist noch knackig wenn es auf den Teller kommt. Die Preise finde ich der Qualität und den Portionen angemessen.<br><br>Nach der Bestellung und dem Bezahlen an der Kasse bekommt man einen Bon mit einer Nummer. Diese Nummer wird auf einem Fernseher &#34;ausgerufen&#34; und man kann sein Essen abholen. Dies vermeidet unnötiges Warten an der Theke.<br><br>Mein einziger Kritikpunkt ist die Organisation der Warteschlange an der Kasse. Die Schlange bildet sich mangels Absperrung oder sonstiger Aufbauten direkt im Bereich des Eingangs, so dass ankommende Gäste sich durchdrängeln müssen, da es recht eng wird.<br><br>Alles in Allem ein gutes Restaurant.",
