"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/EcTLqASk58lsU7Kzr7mXXQ/l.jpg",
"rating":"4.0",
"reviewcomment":"Self control.....two words that are eliminated from my vocabulary when someone mentions Asahi for lunch. I work dangerously close to this delicious running sushi bar! Even if I pack a lunch or tell myself that I&#39;m not going out to eat with anyone for lunch, if Asahi is an option I will change my mind with little to no convincing. Luckily, it t isn&#39;t bad for my wallet, ringing in at only 11 euro for the buffet plus drink and tip. Ding Ding Ding! We have a winning combination!<br><br>What I like most about Asahi&#39;s lunch is the variety of hot/cold items and vegetarian/non-vegetarian items. Even if you eat here every week, I don&#39;t think you&#39;d get sick of it because it&#39;s not the typical &#34;every roll is a california roll&#34; sushi joint. I&#39;m super excited to give their dinner offering a shot sometime, though it is going to cost more than the 11 euro I&#39;m used to forking out  : )<br><br>Seriously, just writing this review has made me wish my coworkers and I go here this week!  :)<br><br>p.s- there are only maybe 8 or 9 tables around the running sushi, so call when they open that day to reserve a spot (no need to call a day early).",
