"rating":"3.5",
"reviewcomment":"We went here for the first time on a Bank Holiday Monday when our usual haunt (Franzz - <a href='/redir?url=http%3A%2F%2Fwww.qype.com%2Fplace%2F367729-Franzz-Muenchen&amp;s=7e32701ea86e8c341087af3d1b8d860ebce0f171e7af2ba29ca5f071b48d9bf3' target='_blank' rel='nofollow'>qype.com/place/367729-Fr…</a> ) was closed.<br><br> I&#39;ve never been tempted to go here before because it backs onto a quite major road and looks like it would be noisy, but actually it turned out to be relatively peaceful with a nice enclosed beer garden.<br><br> The beer garden food is about as good as anywhere I&#39;ve been that has a separate, outdoor bar and cook-house. One surprise is that they seem to serve really nice salads in the beer garden as well as more usual fair.<br><br> Best of all, my favourite of all Bavarian beers, Konig Ludwig Dunkels is on sale here.<br><br> I&#39;d still go to Franzz in preference to here, but if you&#39;re looking for a nice beer garden in West Munich you could do a lot worse than here.",
