"rating":"4.0",
"reviewcomment":"This is a tiny little place.  You&#39;ll probably want to call ahead and book a table.  Very stylish ambiance, modern and sleek.   Service is OK, not great. <br><br>although pho (hot beef noodle soup) is a classic dish of Vietnam, it is PERFECT on a cold rainy/snowy winter day in Munich.  So far, i have only tried the pho, but it was among the best i&#39;ve had -- perfectly cooked noodles, tender tasty beef slices, flavorful broth (almost delicately spiced), and all kinds of fresh herbs (actually a very interesting variety, much more than I&#39;m used to getting in Vietnamese places in California).    <br><br>The price was a lot higher than you may be used to seeing if you&#39;re used to pho in those hole-in-the-wall Vietnamese pho places in California.  But it&#39;s not unreasonably priced, if you consider  how difficult to get &amp; how expensive the ingredients must be in Munich.    Overall, the total experience is really quite nice. <br><br>(p.s. not sure if there&#39;s an English menu or not).",
