"rating":"4.5",
"reviewcomment":"Curry wurst is a staple in most in bier gardens in Munich.  I didn&#39;t understand the appeal - a wiener covered in ketchup with a shake of yellow powder, hmm, thanks but no.<br><br>at Würschtl Bude - I suddenly get it.<br><br>this is a tiny little place, easy to miss (i think I recall a little flag outside that says &#34;Pommes&#34;).  but it&#39;s worth seeking out: the sausage is great, the sauce (much more to it than ketchup) appears to be house-made, i might even call it &#34;nuanced&#34; - and when you are served your order, you choose your level of heat in the curry finale on the dish.  Heat (&#34;scharf&#34;) level goes from zero to 7, with 7 noted as &#34;you must be over 18 to order, and please note the Isar is 300 meters to your right when you exit.&#34;<br><br>Level 3 was pleasantly spicy, watch out since it kind of builds on you.  Fries were awesome, crisp and hot.  <br><br>things to be aware of:  it is PACKED at noon.  and  check on the opening hours, i think it&#39;s only open Monday -Friday 11 am to 6 pm (maybe open longer in summer?).  also they don&#39;t serve beer ...",
