"categorystrlist":"Italian",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/moj4mRHNb25Mk93VCosi5w/l.jpg",
"rating":"4.0",
"reviewcomment":"We no speak Americano, but nice Italiano. Since 1979 in Munich. <a href='/redir?url=http%3A%2F%2Fwww.cadoro.de%2F&amp;s=af5f40bdebaa2bc9b0b30dc2da1c8159768973884af470b669d864fc5e854aa2' target='_blank' rel='nofollow'>cadoro.de</a> <br><br>Best pizza in town. Period. The real italian deal. For that 5 stars review and if possible even more.<br><br>Location accesibility?  5 stars as well, it&#39;s at a walking distance from Central station, offering also a take out service, a serious pizza slice for merely 2-3Euro if you&#39;re on the way. <br><br>Restaurant - Here is where they lose stars in my perspective. They have nice fast service in front at the take away section and also in the restaurant. But the restaurant setting is really too crowded from my point of view. I was once for a dinner with a friend and we stayed at one of the 2 seat tables. It felt crowded, little tables crowded to get as many people in as possible, the waiter was constantly disturbing us to pass and reach the 4 seats places, we were so close to the others that we could basically attend their conversation ...from this point of view, if it&#39;s crowded, I will not  go back there, unless I can enjoy the nice 4 seats places. If it&#39;s crowded, I&#39;d rather take something on the way and eat it into a nice park near by or at home. In a relaxed day it&#39;s totally worth staying .",
