"rating":"3.0",
"reviewcomment":"I came here for the Yelp Burger event last night, and had a really enjoyable evening. We had a table of ~20 people, half of whom spoke German, half English, and even though there was only one server, the service was pretty darn good - got all my drinks and food reasonably quickly. <br><br>I got the Big Frida Burger. I thought it was tasty (especially the sauce and fries), though I wish I could have gotten it done medium instead of well. The bread (which I&#39;m picky about) seemed homemade, but the moisture from the burger and toppings quickly soaked through. But it was delicious and had a unique chewy texture. <br><br>They have a really good beer selection, and  I had my first Munich Mule there last night, which was also pretty good. <br><br>My whole meal - burger w fries, 2 beers, and a Munich Mule, came to 25 euros, so the prices were definitely reasonable.",
